import './App.css';
import Home from './Components/Home';
import Header from './Components/Header';
import { Component } from 'react';``
function App() {
  return (

    <div className="App">
         <Home/>
         <Header/>
      <header className="App-header">


        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
